INSERT INTO `ls_system_setting` VALUES (1,'http://uhha.io:8500','UHHA商城','','','',NULL,'',NULL,'','<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">本协议由缔约双方在自愿、平等、公平及诚实信用原则的基础上，根据《中华人民共和国合同法》等相关法律、法规的规定。本协议由协议正文、附件及依据本协议公示于&ldquo;<span lang=\"EN-US\">.cn</span>&rdquo;开放平台（以下简称&ldquo;平台&rdquo;）的各项规则所组成，协议附件及规则与本协议具有同等法律效力，如规则与本协议约定不一致的，以公布生效日期或签署日期在后的文件为准执行。本协议各条的标题仅为方便阅读而设，无意成为本协议的一部分，也不影响本协议的含义或解释。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;</span><strong><span style=\"font-family: 微软雅黑, sans-serif;\">第一条<span lang=\"EN-US\">&nbsp;</span>相关定义及解释</span></strong></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.1&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">UHHA：北京UHHA世纪贸易有限公司及其旗下子公司、分公司、分支机构或相关关联公司统称为&ldquo;UHHA&rdquo;，本协议中提及的应由甲方或&ldquo;UHHA&rdquo;行使的权利和履行的义务，由&ldquo;UHHA&rdquo;内部负责相应区域及业务范围的公司分别履行。本协议由北京UHHA世纪贸易有限公司代表&ldquo;UHHA&rdquo;与乙方签署。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.2&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&ldquo;UHHA uhha<span lang=\"EN-US\">.io</span>&rdquo;网站：指由&ldquo;UHHA&rdquo;提供技术支持和服务的域名为<span lang=\"EN-US\">&nbsp;Lecshop.cn&nbsp;</span>的网站。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.3&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">UHHA平台：指运行于&ldquo;UHHA uhha<span lang=\"EN-US\">.io</span>&rdquo;网站的&ldquo;UHHA uhha<span lang=\"EN-US\">.io</span>&rdquo;开放平台，是&ldquo;UHHA uhha<span lang=\"EN-US\">.io</span>&rdquo;网站上为用户提供信息发布、交流，第三方经营者开设店铺经营，以及其他技术服务的电子商务交易服务平台。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">1.4&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&ldquo;UHHA uhha<span lang=\"EN-US\">.io</span>&rdquo;网站用户：指所有在&ldquo;UHHA uhha<span lang=\"EN-US\">.io</span>&rdquo;网站上注册成为&ldquo;UHHA uhha<span lang=\"EN-US\">.io</span>&rdquo;注册会员的法人、自然人及其他组织，本协议中统称为&ldquo;用户&rdquo;，除非另有说明，否则&ldquo;用户&rdquo;均指此含义。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.5&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">商家注册及入驻：商家注册指欲成为&ldquo;UHHA平台&rdquo;第三方经营者的商家（本文或称&ldquo;卖家&rdquo;），依据&ldquo;京东平台&rdquo;入驻流程和要求完成在线信息提交，经&ldquo;UHHA&rdquo;审核同意后，商家可以使用其自行设定的京东平台用户名和密码登陆&ldquo;UHHA平台&rdquo;，以开立店铺开展经营；商家入驻，亦称&ldquo;店铺入驻&rdquo;指第三方<span lang=\"EN-US\">&nbsp;</span>经营者完成商家注册，通过资质审核且满足本协议第四条店铺服务开通条件后成为&ldquo;UHHA平台&rdquo;第三方经营者的过程；本协议中的商家指本协议缔约方中的&ldquo;乙方&rdquo;。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.6&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">UHHA平台用户名：亦称&ldquo;店铺用户名&rdquo;，是指商家完成商家注册后获取的与自设密码共同使用以登陆&ldquo;京东平台&rdquo;商家管理系统，使用&ldquo;UHHA平台&rdquo;店铺服务的登陆账户，每一个UHHA平台用户名对应一个店铺。商家应妥善保管店铺用户名及密码信息，不得擅自转让或授权他人使用。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.7&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">店铺：商家在完成商家注册及商家入驻流程后，为进行合法经营，依据协议约定和UHHA平台规则由乙方申请，&ldquo;UHHA&rdquo;审核通过的具有独立且唯一性<span lang=\"EN-US\">&nbsp;ID</span>（英文<span lang=\"EN-US\">&nbsp;IDentity&nbsp;</span>的缩写，意为&ldquo;身份标识号码&rdquo;）、特定名称（可依据相关平台规则进行调整）的网络化虚拟商铺，乙方可依据经营需要，开设一个或多个店铺。乙方通过UHHA平台用户名可以实现对该店铺的管理，包括但不仅限于商品信息上传、修改、删除处理，交易跟踪、取消等。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.8&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">UHHA平台规则：指标示在&ldquo;UHHA平台&rdquo;之上的，与商家经营有关的任何规范性文件，包括但不限于卖家手册、卖家后台公告、卖家后台帮助中心等。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.9&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">保证金：商家向&ldquo;UHHA&rdquo;缴纳的用以保证本协议履行及对商品和服务质量进行担保的金额，&ldquo;UHHA&rdquo;可以依照本协议的相关约定对其进行处置</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.10&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">平台使用费：商家使用&ldquo;UHHA平台&rdquo;各项服务时按照本协议约定缴纳的固定技术服务费用。具体缴纳标准见本协议附件。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.11&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">技术服务费：商家根据经营类目在达成每一单交易时按比例向&ldquo;UHHA&rdquo;缴纳的技术服务费用，具体缴纳标准及方式见本协议附件。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><strong><span lang=\"EN-US\" style=\"font-family: 微软雅黑, sans-serif;\">&nbsp;</span></strong><strong><span style=\"font-family: 微软雅黑, sans-serif;\">第二条<span lang=\"EN-US\">&nbsp;</span>服务内容及乙方店铺经营方式</span></strong></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.1&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">甲方依照本协议第四条约定为乙方开通店铺服务后，乙方可使用&ldquo;UHHA平台&rdquo;发布商品信息，与愿意购买乙方商品的甲方其他用户进行在线交流，订立买卖合同，并向通过&ldquo;UHHA平台&rdquo;购买其商品的用户提供售后服务，同时可参与&ldquo;UHHA平台&rdquo;相关活动及使用&ldquo;UHHA平台&rdquo;同意提供的其他有偿服务。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.2&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">除上述服务内容外，乙方可使用本协议附件列明的其他甲方提供的有偿服务，具体服务内容以本协议附件约定或双方另行签署（含乙方同意相关有偿服务的电子协议等以数据电文形式签署）的文件约定为准。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.3&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方店铺经营方式：乙方店铺内商品，均以乙方自身名义进行商品信息上传、展示、咨询答复、商品销售、发票开具、物流配送服务及售后服务提供等；乙方销售及服务出现争议、纠纷、国家机关机构调查时，由乙方以销售者身份处理。&ldquo;UHHA&rdquo;不参与乙方店铺的经营中，除依据本协议相关约定外，也</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">不直接介入乙方与其他人间的争议和纠纷。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><strong><span style=\"font-family: 微软雅黑, sans-serif;\">第三条<span lang=\"EN-US\">&nbsp;</span>入驻条件及证明文件提交</span></strong></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;3.1&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">入驻条件乙方申请成为&ldquo;UHHA平台&rdquo;入驻商家，在&ldquo;UHHA平台&rdquo;开展经营活动，须满足以下条件：</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1)&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方已依照中华人民共和国法律注册并领取合法有效的营业执照及其他经营许可；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2)&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方申请经营的商品来源合法，资质齐全；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3)&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方同意本协议及UHHA平台相关规则。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;3.2&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">证明文件提交</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;3.2.1&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方须根据UHHA平台相关规则及要求向甲方提交证明文件或其他相关证明，包括但不限于营业执照、税务登记证、授权委托书、商标注册证、质检报告、报关单、检验检疫证书、产品来源地证明等。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;3.2.2&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方保证向甲方提供的上述证明文件或其他相关证明真实、合法、准确、有效，并保证上述证明文件或其他相关证明发生任何变更或更新时，及时通知甲方，若上述文件变更或更新导致乙方不符合本协议所规定入驻条件的，甲方有权单方全部或部分限制乙方经营，直至终止本协议。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;3.2.3&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方对其提交的证明文件或其他相应证明的真实性、合法性、准确性、有效性承担全部法律责任，若因乙方提交虚假、过期文件或未及时更新或通知证明文件导致纠纷或被相关国家机关处罚的，由乙方独立承担全部法律责任，如因此造成UHHA（包括&ldquo;UHHA&rdquo;合作方、代理人或职员）损失的，乙方应予以赔偿。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><strong><span style=\"font-family: 微软雅黑, sans-serif;\">第四条<span lang=\"EN-US\">&nbsp;</span>店铺服务开通及停止</span></strong></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;4.1&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">对于乙方拟开展经营的特定店铺，甲方在乙方提出开店申请并满足以下条件后<span lang=\"EN-US\">&nbsp;7&nbsp;</span>个工作日内为乙方开通服务，甲方将在服务正式开通前一个工作日以邮件方式通知乙方。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;1)&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方已按照本协议附件《乙方信息确认表》或者其他补充协议（若有）中确定的金额足额缴纳保证金；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;2)&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方已按照本协议及UHHA平台相关规则提交证明文件或其他相关证明并已通过甲方审核；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;3)&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方已注册成为UHHA平台用户且本协议已签署生效；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;4)&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方已按照附件《店铺信息表》或相关补充协议（若有）足额缴纳特定店铺相应服务期的平台使用费。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;4.2&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">甲方为乙方开通服务后，乙方可利用UHHA平台用户名及自设密码登陆商家后台，根据UHHA平台相关规则及流程向乙方特定店铺上传、发布商品信息，与用户交流达成交易，使用本协议约定的其他有偿服务等。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;4.3&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方店铺服务的停止：</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">4.3.1&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方需要停止店铺服务的，应至少提前七个工作日向甲方提出申请，经甲方审核同意后由甲方停止该店铺的服务功能；为弥补甲方已投入的人力、物力和技术支持，乙方同意甲方不退还该店铺未到期部分对应的平台使用费；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;4.3.2&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">出现以下任一情形时，甲方有权随时停止乙方相关店铺的服务；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;4.3.2.1&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方不满足入驻条件的；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;4.3.2.2&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方提供虚假资质文件的；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;4.3.2.3&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方未完成承诺销售额的；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;4.3.2.4&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方产品价格、规格等信息标示错误，导致行政处罚、争议和纠纷的；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;4.3.2.5&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方产品质量、标识不合格的，或者产品涉嫌走私、假冒伪劣、旧货、返修品的；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;4.3.2.6&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">未经甲方事先审核产品品牌，而上传某品牌商品的；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;4.3.2.7&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方连续<span lang=\"EN-US\">&nbsp;30</span>（三十）日或累计<span lang=\"EN-US\">&nbsp;45</span>（四十五）日未正常经营店铺的；</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;4.3.2.8&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">其他违反本协议约定或UHHA平台规则的，或者其他甲方认为侵犯UHHA或消费者权益的。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;4.4&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方未经甲方同意，擅自停止店铺经营，或者乙方因为出现<span lang=\"EN-US\">&nbsp;4.3.2&nbsp;</span>情形被甲方停止店铺服务的，乙方已缴纳的相关店铺的平台使用费未到期部分，作为乙方向甲方支付的违约金，该金额不足以冲抵乙方应付违约金和赔偿金时，乙方应另行支付差额。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><strong><span style=\"font-family: 微软雅黑, sans-serif;\">第五条<span lang=\"EN-US\">&nbsp;</span>双方权利及义务</span></strong></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;5.1&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">甲方根据本协议向乙方提供电子商务交易平台及相应技术支持服务，尽力维护&ldquo;UHHA平台&rdquo;的正常稳定运行，并努力提升和改进技术，对平台功能及服务进行更新、升级，不断提升平台性能和交易效率。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;5.2&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">甲方对乙方在使用&ldquo;UHHA平台&rdquo;过程中遇到的问题及提出的建议和意见积极予以回复，可依乙方需求对其使用&ldquo;UHHA平台&rdquo;提供合理的指导和培训。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;5.3&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方同意甲方根据乙方营业执照所载明的经营范围及乙方申请经营的经营类目，核实及调整乙方在&ldquo;京<span lang=\"EN-US\">&nbsp;</span>东平台&rdquo;经营的具体商品的种类、数量和类目范围。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;5.4&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方同意并自愿遵守甲方根据国家相关法律法规、政策及平台运营情况，对公示于&ldquo;UHHA平台&rdquo;的规则、流程、收费标准等进行更新、调整。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;5.5&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方同意甲方对乙方提供的相关资质文件及各类信息资料进行审核。甲方审核为形式审核，审核通过并不代表甲方对审核内容的真实性、合法性、准确性、及时性的确认，乙方仍须对其提交的资料的真实性、合法性、准确性、及时性等承担相应的法律责任。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;5.6&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">甲方有权对乙方的注册信息、上传的相关数据信息、在&ldquo;UHHA平台&rdquo;发布的其他信息及交易行为进行监督检查，对发现的违法违规信息及其相关内容，乙方同意甲方不经通知立即删除，对发现的其他问题或疑问有权向乙方发出询问及要求改正的通知，乙方应在接到通知后立即做出说明或改正。对乙方前述不当行为，甲方有权追究其违约、侵权责任并<span lang=\"EN-US\">/</span>或解除本协议。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;5.7&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">甲方有权将经国家生效法律文书或行政文书确定的乙方违法违规事件，或乙方已确认的乙方违反本协议相关约定的事项，在&ldquo;UHHA平台&rdquo;上予以公示；乙方多次违规或者有严重违约、违规情形的，甲方有权对其采取暂停店铺运营、扣除保证金直至终止本协议等措施，上述措施不足以补偿甲方损失的，甲方有权继续向乙方追偿。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp; &nbsp; 5.8&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">如乙方的运营情况不能满足&ldquo;UHHA平台&rdquo;要求，经限期整改调整后，仍无法满足平台运营条件的，甲方有权解除本协议，停止向乙方提供服务。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;5.9&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">甲方有权根据市场情况及&ldquo;UHHA平台&rdquo;入驻商家经营情况组织相应的促销活动，乙方应根据自身经营<span lang=\"EN-US\">&nbsp;</span>情况及商品情况积极予以支持。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;5.10&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">甲方有权要求乙方提供与乙方商品、售后服务等相关的信息，以便于客户直接向&ldquo;UHHA平台&rdquo;客服中心进行咨询时予以回复，对于甲方无法回答或属乙方掌握的情况，甲方有权要求乙方在指定的时限内予以回复或给出相应方案，对乙方未及时解决的客户咨询及投诉，甲方有权对乙方采取相应处理措施。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">5.11&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">如因乙方商品、发布的信息或提供的售后服务问题而引发客户对甲方及<span lang=\"EN-US\">/</span>或&ldquo;UHHA平台&rdquo;的诉讼，甲方及<span lang=\"EN-US\">/</span>或&ldquo;UHHA平台&rdquo;有权披露乙方为实际商品提供商，乙方应承担因客户诉讼而产生的全部法律责任，如因此而给甲方及<span lang=\"EN-US\">/</span>或&ldquo;UHHA平台&rdquo;造成损失的，甲方有权要求乙方赔偿甲方及&ldquo;UHHA平台&rdquo;的全部损失。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;5.12&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">乙方同意&ldquo;UHHA&rdquo;根据业务调整情况将本协议项下的权利和义务部分或全部转移给甲方关联公司，但须提前<span lang=\"EN-US\">&nbsp;5&nbsp;</span>日通知乙方。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 13.95pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><strong><span style=\"font-family: 微软雅黑, sans-serif;\">第六条<span lang=\"EN-US\">&nbsp;</span>乙方声明及保证</span></strong></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 13.95pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;6.1&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">保证在&ldquo;UHHA平台&rdquo;提交的注册资料真实、准确、合法、有效，对获得的与自设密码共同使用的UHHA平台用户名（店铺用户名）妥善保管，不得擅自转让或授权他人使用，并对利用该用户名和密码所进行的一切活动负全部责任。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 13.95pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;6.2&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">保证符合本协议约定的入驻条件，保证向甲方提交的证明文件及其他相关证明真实、准确、合法、有效，并保证在上述资料发生变更时及时通知甲方，并在&ldquo;UHHA平台&rdquo;上予以更新。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 13.95pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;6.3&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">保证其有权利订立本协议，其代理人已获得充分授权，并对代理人的行为承担法律责任，同时乙方保证对其雇员、本协议约定的联系人及其他乙方委派的履行本协议的人员的行为承担法律责任。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 13.95pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;6.4&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">保证遵守本协议及附件的相关约定和UHHA平台相关规则及流程，在使用&ldquo;UHHA平台&rdquo;相关服务时严格<span lang=\"EN-US\">&nbsp;</span>按照上述约定及规则和流程使用，不从事任何有损甲方利益的行为。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 13.95pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;6.5&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">保证对在&ldquo;UHHA平台&rdquo;经营的商品拥有合法销售权，商品质量合格，符合国家相关质量标准，不侵犯任何第三方的合法权利，并对其商品质量及商品合法性独立承担全部法律责任。</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 12.85pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\">&nbsp;</p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 13.95pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\" align=\"left\"><span lang=\"EN-US\" style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;6.6&nbsp;</span><span style=\"font-size: 9pt; font-family: 微软雅黑, sans-serif;\">保证在&ldquo;UHHA平台&rdquo;发布的商品信息真实、准确，符合UHHA平台规则及国家相关法律法规的规定，与实际出售的商品一致，不含任何夸大或虚假内容，并对商品信息承担独立的完全的法律责任。若发布的上述信息变更的，乙方应及时在&ldquo;UHHA平台&rdquo;予以更新。若因信息未及时变更引起法律后果的，乙方独立承担全部责任。</span></p>','','',NULL,'','18000000001','','','1','0','1','','http://uhha.io:8091/',NULL);
