CREATE TABLE `oms_shopping_cart` (
                                     `id` bigint NOT NULL AUTO_INCREMENT COMMENT '主键id',
                                     `customer_id` bigint NOT NULL COMMENT '会员id',
                                     `sku_id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '单品id',
                                     `store_id` bigint NOT NULL COMMENT '店铺id',
                                     `num` int NOT NULL COMMENT '单品数量',
                                     `marketing_id` bigint DEFAULT NULL COMMENT '默认的营销id(满减或者满折)',
                                     `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '删除标记 0 未删除 1删除 默认0',
                                     `create_time` datetime DEFAULT NULL COMMENT '创建时间',
                                     `spu_id` bigint DEFAULT NULL,
                                     `distribute_user_id` bigint DEFAULT NULL COMMENT '视频带货记录推广人用户id',
                                     PRIMARY KEY (`id`) USING BTREE,
                                     UNIQUE KEY `customer_id` (`customer_id`,`sku_id`) USING BTREE,
