CREATE TABLE `short_video` (
                               `uid` bigint NOT NULL COMMENT '用户id',
                               `spu_id` bigint DEFAULT NULL COMMENT '商品id',
                               `video_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '视频id',
                               `video_file_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL,
                               `video_url` varchar(512) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '视频链接',
                               `front_image_url` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '封面图片',
                               `status` int DEFAULT '0' COMMENT '状态 0 审核中 1 审核通过 2 审核未通过 ',
                               `hours` int DEFAULT NULL COMMENT '时长小时',
                               `minutes` int DEFAULT NULL COMMENT '时长分钟',
                               `seconds` int DEFAULT NULL COMMENT '时长秒',
                               `create_time` datetime DEFAULT NULL COMMENT '创建时间',
                               `create_by` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '创建者',
                               `location` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '位置名称',
                               `longitude` float(32,0) DEFAULT NULL COMMENT '坐标',
                               `latitude` float(32,0) DEFAULT NULL,
                               `title` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '标题',
                               `content` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci COMMENT '文本内容',
                               `front_page` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '封面图片',
                               `topic_list` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '话题列表',
                               `product_list` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci COMMENT '产品列表',
                               `having_product` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '是否推销产品',
                               `pv` int DEFAULT '0' COMMENT '播放量',
                               `likedQty` int DEFAULT '0' COMMENT '点赞数',
                               `collectedQty` int DEFAULT '0' COMMENT '收藏数',
                               `repliedQty` int DEFAULT '0' COMMENT '回复数',
                               PRIMARY KEY (`video_id`) USING BTREE,
                               KEY `uid_idx` (`uid`) USING BTREE,
                               KEY `vid_idx` (`video_id`) USING BTREE,
                               KEY `loc_idx` (`location`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC COMMENT='短视频表';
