                              `is_email_verification` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '邮箱是否验证   0 否 1 验证  默认0  ',
                              `is_google_verification` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '手机是否验证  0 否 1 验证 默认0',
