                              `allow_fiat_withdraw` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '是否允许法定货币提现 0 否 1 是  默认0',
                              `allow_crypto_withdraw` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '是否允许虚拟币提现 0 否 1 是  默认0',
