                              `applet_open_id` varchar(55) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
                              `app_open_id` varchar(55) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
                              `h5_open_id` varchar(55) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
                              `firstname` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '名',
                              `lastname` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '姓',
                              `nationality` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '国籍',
                              `nationality_id` int DEFAULT NULL COMMENT '国家id',
                              `idtype` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '实名认证类型',
                              `certificate1` varchar(512) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '实名认证证明材料1地址',
