DROP TABLE IF EXISTS `ums_member_address`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `ums_member_address` (
                                      `id` bigint NOT NULL AUTO_INCREMENT COMMENT '主键id',
                                      `customer_id` bigint DEFAULT NULL COMMENT '用户id  对应ums_member表中的id',
                                      `name` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '收货人姓名',
                                      `mobile` varchar(12) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '手机号码',
                                      `phone` varchar(12) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '收货人固定电话',
                                      `zip_code` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '邮编',
                                      `address` varchar(124) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '收货人地址（省＋市＋区）',
                                      `detail_address` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '收货人详细地址',
                                      `country_id` bigint DEFAULT NULL COMMENT '国家id',
                                      `province_id` bigint DEFAULT NULL COMMENT '省id',
                                      `city_id` bigint DEFAULT NULL COMMENT '市id',
                                      `county_id` bigint DEFAULT NULL COMMENT '区县id',
                                      `is_default` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '是否默认收货地址  0 否 1 是  默认0 ',
                                      `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '删除标记  0 未删除 1 删除',
                                      `create_time` datetime DEFAULT NULL COMMENT '创建时间',
                                      `del_time` datetime DEFAULT NULL COMMENT '删除时间',
                                      `update_time` datetime DEFAULT NULL COMMENT '更新时间',
                                      PRIMARY KEY (`id`) USING BTREE,
                                      KEY `customer_id` (`customer_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='用户收货地址';
